    public static String getProgressIcon(int current, int max) {
        int progress = (int) Math.ceil((double) current / max * 5);
//        FactionsMod.LOGGER.info(current + "/" + max + "*5=" + progress);
        return switch (progress) {
            case 1 -> GUI_PROGRESS_1;
            case 2 -> GUI_PROGRESS_2;
            case 3 -> GUI_PROGRESS_3;
            case 4 -> GUI_PROGRESS_4;
            case 5 -> GUI_PROGRESS_5;
            default -> GUI_PROGRESS_1;
        };
    }
    public static String getNumberIcon(int number) {
        if (number <= 0) return GUI_COUNT_0;
        if (number >= 9) return GUI_COUNT_9;
        return switch (number) {
            case 1 -> GUI_COUNT_1;
            case 2 -> GUI_COUNT_2;
            case 3 -> GUI_COUNT_3;
            case 4 -> GUI_COUNT_4;
            case 5 -> GUI_COUNT_5;
            case 6 -> GUI_COUNT_6;
            case 7 -> GUI_COUNT_7;
            case 8 -> GUI_COUNT_8;
            default -> GUI_COUNT_0;
        };
    }
